import React from 'react';
import { View, Text, StyleSheet, ScrollView } from "react-native";
import { Header } from "@rneui/base";
import { Icon, Avatar } from 'react-native-elements';

export default function ListaTell({ navigation }) {

    return (
        <>
            <Header
                backgroundImageStyle={{}}
                barStyle="default"
                centerComponent={{
                    text: "Novo Contato",
                    style: { color: "#fff", fontWeight: "bold" }
                }}
                centerContainerStyle={{}}
                leftContainerStyle={{
                    flex: 1,
                    alignItems: 'flex-start',
                    justifyContent: 'center',
                    paddingLeft: 10,
                }}
                leftComponent={
                    <Icon
                        name="arrow-left"
                        color="#fff"
                        onPress={goToLogin}
                    />
                }
                linearGradientProps={{}}
                placement="center"
                rightComponent={{}}
                rightContainerStyle={{}}
                statusBarProps={{}}
                containerStyle={{ backgroundColor: "#1670f7" }}
            />

            <ScrollView>
                <View style={styles.container}>
                    {
                        list.map((l, i) => (
                            <View key={i} style={styles.listItem}>
                                <Avatar
                                    size="medium"
                                    rounded
                                    source={{
                                        uri: l.avatar_url,
                                    }}
                                />
                                <Text style={styles.name}>{l.name}</Text>
                            </View>
                        ))
                    }
                </View>
            </ScrollView>
        </>
    );
}

const styles = StyleSheet.create({
    container: {
        flexDirection: 'column',
    },
    listItem: {
        display: 'flex',
        flexDirection: 'row',
        gap: '5%',
    },
    name: {
        marginTop: 8,
        textAlign: 'center',
        fontSize: 18,
        fontWeight: 'bold',
    },
});
